import React from 'react'
import { Link } from 'react-router-dom'

const UserList = ({users}) => {
  return (
    <div className="UsersList">
      {users.map(user => 
      <div>
        <Link to={`/users/${user.id}`}>{user.name}, </Link>
        <p>{user.email}</p>
      </div>)}
    </div>
  )
}

export default UserList
